import React from 'react'
import Loader from 'react-loader-spinner';

const Loading = () => {
  return (
    <div classname="flex justify-center items-center">
        <Loader type="Puff" color="#00BFFF" height={550} width={80}/>
    </div>
  )
}

export default Loading
